import LeaseLines from "../APIs/LeaseLines"
import wells from "../APIs/wells"
import {
  POST_LEASE_LINES_TO_JSONDB_REQUESTED,
  POST_LEASE_LINES_TO_JSONDB_RECEIVED, 
  POST_LEASE_LINES_TO_JSONDB_FAILED
} from "./types"

export default (wellInfoAndLeaseLines) => {
  return async dispatch => {
    dispatch({
      type: POST_LEASE_LINES_TO_JSONDB_REQUESTED
    })
    try{
      const response = await wells.get("wells")
      // const response = await LeaseLines.post("LeaseLines", wellInfoAndLeaseLines)
      dispatch({
        type: POST_LEASE_LINES_TO_JSONDB_RECEIVED,
        payload: response 
      })
    } catch(error) {
      dispatch({
        type: POST_LEASE_LINES_TO_JSONDB_FAILED,
        payload: error
      })
    }
  }
}
